import "./menu.css";

const Menu = () => {
  const menu = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];
  return (
    <nav className="navbar width-50">
      {menu.map((item, index) => {
        return (
          <div className="nav-item fs-6">
            <i key={index} className={item.icon}></i> {item.type}
          </div>
        );
      })}
    </nav>
  );
};

export default Menu;
